import SubjectItem from "./SubjectItem";

const SubjectItemList = ({subjects}) => {
    return (
        <div>
            <ul>
                {
                    subjects.map((subject) => {
                        return (
                            <SubjectItem id={subject.id} name={subject.name}/>
                        )
                    })
                }
            </ul>
        </div>
    )
}

export default SubjectItemList;
